They were both very good boys today, It was Aero’s third ever show and first ever dressage test😳😂 he warmed up so nicely and then he went to the arena and just thought it was all very exciting so he got 59% which was much better than I thought! Then I did the novice with Snoopy and he was awesome to get 67.40% which was good as we didn’t get enough warm up. And our team came 4th to qualify for keysoe champions! Then Snoopy was so good in the arena Eventing/jumping with style, to get a really nice fast clear, and I was so pleased as we have had a couple of poles down on our last competitions! And we came 6th out of like 40 people to qualify for keysoe!! So pleased with both ponies, Aero was so good even if he didn’t get the best score his temperament was very good! And it was very good for experience with him as well !
